import "./Log.css";
import React, { useRef, useState } from "react";
import { useAuth } from "../contexts/AuthContext";
import { useHistory } from "react-router-dom";
export default function Log_sign() {
  const emailRef = useRef();
  const passwordRef = useRef();
  const { login } = useAuth();
  const [error, setError] = useState("Log In");
  const [loading, setLoading] = useState(false);
  const history = useHistory();
  const [log, changelog] = useState(true);
  const [sign, changesign] = useState(false);
  const func1 = () => {
    changelog(true);
    changesign(false);
  };
  const func2 = () => {
    changesign(true);
    changelog(false);
  };

  async function handleSubmit(e) {
    e.preventDefault();

    try {
      setError("");
      setLoading(true);
      await login(emailRef.current.value, passwordRef.current.value);
      history.push("/");
    } catch {
      setError("Failed to log in");
    }

    setLoading(false);
  }

  return (
    <div className="LogMain1">
      {log && (
        <div className="Login">
          <div className="logsubs">
            <div className="loghead">
              <p className="loginhead">{error}</p>
            </div>
            <form onSubmit={handleSubmit} className="formlog">
              <div className="loginsub1">
                <div className="loginsub11">
                  <div className="ipdiv">
                    <div className="inputlog">
                      <input
                        className="inputlogip"
                        type="text"
                        ref={emailRef}
                        placeholder="Email"
                        required
                      />
                    </div>
                    <div className="inputlog">
                      <input
                        className="inputlogip"
                        type="text"
                        ref={passwordRef}
                        required
                        placeholder="Password"
                      />
                    </div>
                  </div>
                  <div className="inputlogbtn">
                    <button className="inputlogbtn1" type="submit">
                      Log In
                    </button>
                  </div>
                  <p className="su" onClick={func2}>
                    Forgot Password
                  </p>
                </div>
              </div>
            </form>
            <div className="loginsub2"></div>
          </div>
        </div>
      )}
      {!log && (
        <div className="Login2" onClick={func1}>
          <p className="largehead">Log In</p>
        </div>
      )}
      {sign && (
        <div className="Login">
          <div className="logsubs">
            <div className="loghead2">
              <p className="loginhead">Sign Up</p>
            </div>
            <div className="loginsub122">
              <div className="loginsub112">
                <div className="ipdiv">
                  <div className="inputlog1">
                    <input
                      className="inputlogip"
                      type="text"
                      placeholder="Email"
                    />
                  </div>
                  <div className="inputlog1">
                    <input
                      className="inputlogip"
                      type="text"
                      placeholder="Password"
                    />
                  </div>
                  <div className="inputlog1">
                    <input
                      className="inputlogip"
                      type="text"
                      placeholder="Confirm Password"
                    />
                  </div>
                </div>
                <div className="inputlogbtn2">
                  <button className="inputlogbtn21">Sign Up</button>
                </div>
              </div>
            </div>
            <div className="loginsub2"></div>
          </div>
        </div>
      )}
      {!sign && (
        <div className="signup2" onClick={func2}>
          <p className="largehead">Sign Up</p>
        </div>
      )}
    </div>
  );
}
